// src/pages/Home.js
import React, { useEffect, useState } from "react";
import axios from "axios";
import {
  Grid,
  Card,
  CardContent,
  Typography,
  Button,
  Stack,
  Box,
  AppBar,
  Toolbar,
  IconButton,
  Container,
} from "@mui/material";
import { useNavigate } from "react-router-dom";
import { motion } from "framer-motion";
import VisibilityIcon from "@mui/icons-material/Visibility";
import DownloadIcon from "@mui/icons-material/Download";
import AdminPanelSettingsIcon from "@mui/icons-material/AdminPanelSettings";
import ContactMailIcon from "@mui/icons-material/ContactMail";

const Home = () => {
  const [adminData, setAdminData] = useState(null);
  const navigate = useNavigate();

  useEffect(() => {
    axios
      .get("http://localhost:5000/api/admin")
      .then((res) => setAdminData(res.data))
      .catch((err) => console.error("Error fetching admin data:", err));
  }, []);

  const options = [
    {
      title: "Register Now",
      description:
        "Join the Innovation Ignite Symposium using the official Google Form.",
      viewLink: adminData?.registration?.googleFormLink || "",
    },
    {
      title: "Symposium Rulebook",
      description: "Access symposium rules and guidelines.",
      viewLink: adminData?.rulebooks?.symposium,
      downloadLink: adminData?.rulebooks?.symposium,
    },
    {
      title: "Quiz Competition",
      description: "Quiz competition rules and instructions.",
      viewLink: adminData?.rulebooks?.quiz,
      downloadLink: adminData?.rulebooks?.quiz,
    },
    {
      title: "Mini Hackathon",
      description: "Hackathon rulebook and guidelines.",
      viewLink: adminData?.rulebooks?.hackathon,
      downloadLink: adminData?.rulebooks?.hackathon,
    },
    {
      title: "Model Presentation",
      description: "Model presentation event rules.",
      viewLink: adminData?.rulebooks?.model,
      downloadLink: adminData?.rulebooks?.model,
    },
  ];

  return (
    <Box
      sx={{
        backgroundColor: "#0a0a0a",
        color: "#fff",
        minHeight: "100vh",
        pb: 5,
      }}
    >
      {/* ðŸ”¹ Navbar */}
      <AppBar
        position="sticky"
        sx={{
          backgroundColor: "#121212",
          borderBottom: "1px solid #222",
          py: 1,
        }}
      >
        <Toolbar sx={{ justifyContent: "space-between" }}>
          <Stack direction="row" spacing={2} alignItems="center">
            <img
              src="/assets/CLG_LOGO.png"
              alt="College Logo"
              width="45"
              height="45"
              style={{ borderRadius: "8px" }}
            />
            <img
              src="/assets/clublogo.png"
              alt="Club Logo"
              width="45"
              height="45"
              style={{ borderRadius: "8px" }}
            />
            <img
              src="/assets/SYMPO.jpg"
              alt="Symposium Logo"
              width="45"
              height="45"
              style={{ borderRadius: "8px" }}
            />
            <Typography
              variant="h6"
              sx={{ fontWeight: "bold", color: "#e53935", ml: 1 }}
            >
              Innovation Ignite 2025
            </Typography>
          </Stack>

          <Stack direction="row" spacing={2}>
            <Button
              variant="outlined"
              color="inherit"
              startIcon={<ContactMailIcon />}
              onClick={() => navigate("/contact")}
            >
              Contact
            </Button>
            <Button
              variant="contained"
              sx={{ backgroundColor: "#e53935" }}
              startIcon={<AdminPanelSettingsIcon />}
              onClick={() => navigate("/admin")}
            >
              Admin
            </Button>
          </Stack>
        </Toolbar>
      </AppBar>

      {/* ðŸ”¹ Header Section */}
      <Container sx={{ textAlign: "center", py: 6 }}>
        <Typography
          variant="h3"
          sx={{
            fontWeight: "bold",
            color: "#e53935",
            mb: 2,
          }}
        >
          Innovation Ignite Symposium 2025
        </Typography>
        <Typography
          variant="h6"
          sx={{
            color: "#ccc",
            maxWidth: "800px",
            mx: "auto",
          }}
        >
          A fusion of innovation, creativity, and technology â€” join us to ignite
          the spark of ideas that shape tomorrow.
        </Typography>
      </Container>

      {/* ðŸ”¹ Announcements Section */}
      <Container sx={{ mb: 6 }}>
        <Box
          sx={{
            backgroundColor: "#121212",
            borderRadius: "12px",
            p: 3,
            boxShadow: "0 0 10px rgba(255,255,255,0.1)",
          }}
        >
          <Typography
            variant="h5"
            sx={{
              mb: 2,
              fontWeight: "600",
              color: "#ff7043",
            }}
          >
            ðŸ“¢ Announcements
          </Typography>
          <Stack spacing={1}>
            {adminData?.announcements?.length > 0 ? (
              adminData.announcements.map((note, i) => (
                <Typography key={i} variant="body1">
                  â€¢ {note}
                </Typography>
              ))
            ) : (
              <Typography variant="body2" color="#888">
                No announcements yet. Stay tuned!
              </Typography>
            )}
          </Stack>
        </Box>
      </Container>

      {/* ðŸ”¹ Event Options Section */}
      <Container sx={{ mb: 6 }}>
        <Grid container spacing={3}>
          {options.map((item, index) => (
            <Grid item xs={12} md={6} lg={4} key={index}>
              <motion.div
                initial={{ opacity: 0, y: 30 }}
                animate={{ opacity: 1, y: 0 }}
                transition={{ duration: 0.4, delay: index * 0.1 }}
              >
                <Card
                  sx={{
                    backgroundColor: "#1e1e1e",
                    borderRadius: "16px",
                    boxShadow: "0px 4px 20px rgba(0,0,0,0.5)",
                    "&:hover": { transform: "scale(1.03)" },
                    transition: "0.3s",
                  }}
                >
                  <CardContent>
                    <Typography
                      variant="h6"
                      sx={{ fontWeight: "600", color: "#90caf9", mb: 1 }}
                    >
                      {item.title}
                    </Typography>
                    <Typography
                      variant="body2"
                      sx={{ color: "#ccc", mb: 2 }}
                    >
                      {item.description}
                    </Typography>

                    <Stack direction="row" spacing={2}>
                      {item.viewLink && (
                        <Button
                          variant="contained"
                          startIcon={<VisibilityIcon />}
                          href={item.viewLink}
                          target="_blank"
                          sx={{
                            backgroundColor: "#2196f3",
                            "&:hover": { backgroundColor: "#1976d2" },
                          }}
                        >
                          View
                        </Button>
                      )}
                      {item.downloadLink && (
                        <Button
                          variant="outlined"
                          startIcon={<DownloadIcon />}
                          href={item.downloadLink}
                          target="_blank"
                          sx={{
                            borderColor: "#90caf9",
                            color: "#90caf9",
                            "&:hover": {
                              borderColor: "#2196f3",
                              color: "#2196f3",
                            },
                          }}
                        >
                          Download
                        </Button>
                      )}
                    </Stack>
                  </CardContent>
                </Card>
              </motion.div>
            </Grid>
          ))}
        </Grid>
      </Container>

      {/* ðŸ”¹ Contact Section */}
      <Box
        sx={{
          backgroundColor: "#121212",
          py: 6,
          textAlign: "center",
          borderTop: "1px solid #333",
        }}
      >
        <Typography variant="h5" sx={{ color: "#ff7043", mb: 1 }}>
          ðŸ“ž Contact Us
        </Typography>
        <Typography variant="body1" sx={{ color: "#aaa", mb: 2 }}>
          Got questions? Reach out to our symposium team for details.
        </Typography>
        <Button
          variant="contained"
          sx={{
            backgroundColor: "#e53935",
            "&:hover": { backgroundColor: "#d32f2f" },
          }}
          onClick={() => navigate("/contact")}
        >
          Go to Contact Page
        </Button>

        <Typography
          variant="body2"
          sx={{ color: "#555", mt: 4, fontSize: "0.8rem" }}
        >
          Â© 2025 Innovation Ignite Symposium | Developed by Club Innovators
        </Typography>
      </Box>
    </Box>
  );
};

export default Home;
